import React, { useContext, useState } from 'react';
import { Link } from 'react-router-dom';
import { AuthContext } from '../contexts/AuthContext';

const Navbar = () => {
  const { currentUser, logout } = useContext(AuthContext);
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  
  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  return (
    <nav className="bg-blue-600 text-white shadow-md">
      <div className="container mx-auto px-4 py-3">
        <div className="flex justify-between items-center">
          <Link to="/" className="text-xl font-bold">Fake News Detector</Link>
          
          {/* Mobile menu button */}
          <button 
            className="md:hidden"
            onClick={toggleMenu}
          >
            <svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 6h16M4 12h16M4 18h16" />
            </svg>
          </button>
          
          {/* Desktop menu */}
          <div className="hidden md:flex items-center space-x-4">
            <Link to="/" className="hover:text-blue-200">Home</Link>
            <Link to="/contact" className="hover:text-blue-200">Contact</Link>
            
            {currentUser ? (
              <>
                <Link to="/check-news" className="hover:text-blue-200">Check News</Link>
                <Link to="/history" className="hover:text-blue-200">History</Link>
                <Link to="/profile" className="hover:text-blue-200">Profile</Link>
                
                {currentUser.role === 'admin' && (
                  <Link to="/admin" className="hover:text-blue-200">Admin</Link>
                )}
                
                <button 
                  onClick={logout}
                  className="bg-red-500 hover:bg-red-600 text-white px-3 py-1 rounded"
                >
                  Logout
                </button>
              </>
            ) : (
              <>
                <Link 
                  to="/login"
                  className="bg-white text-blue-600 hover:bg-blue-100 px-3 py-1 rounded"
                >
                  Login
                </Link>
                <Link 
                  to="/register"
                  className="bg-blue-800 hover:bg-blue-900 text-white px-3 py-1 rounded"
                >
                  Register
                </Link>
              </>
            )}
          </div>
        </div>
        
        {/* Mobile menu */}
        {isMenuOpen && (
          <div className="md:hidden mt-3 space-y-2">
            <Link to="/" className="block hover:text-blue-200">Home</Link>
            <Link to="/contact" className="block hover:text-blue-200">Contact</Link>
            
            {currentUser ? (
              <>
                <Link to="/check-news" className="block hover:text-blue-200">Check News</Link>
                <Link to="/history" className="block hover:text-blue-200">History</Link>
                <Link to="/profile" className="block hover:text-blue-200">Profile</Link>
                
                {currentUser.role === 'admin' && (
                  <Link to="/admin" className="block hover:text-blue-200">Admin</Link>
                )}
                
                <button 
                  onClick={logout}
                  className="block bg-red-500 hover:bg-red-600 text-white px-3 py-1 rounded w-full text-left"
                >
                  Logout
                </button>
              </>
            ) : (
              <>
                <Link 
                  to="/login"
                  className="block bg-white text-blue-600 hover:bg-blue-100 px-3 py-1 rounded w-full"
                >
                  Login
                </Link>
                <Link 
                  to="/register"
                  className="block bg-blue-800 hover:bg-blue-900 text-white px-3 py-1 rounded w-full"
                >
                  Register
                </Link>
              </>
            )}
          </div>
        )}
      </div>
    </nav>
  );
};

export default Navbar;
